/**
 * @param {number[]} changed
 * @return {number[]}
 */
// done with 3 hints on Description panel
var findOriginalArray = function(changed) {
    if (changed.length % 2 !== 0) return [];

    // const start = Date.now();
    changed.sort((a, b) => a - b);
    const doubleOriginalIndexMap = {};

    let i = 0;
    while (i < changed.length) {
        // console.log(i, changed[i]);
        // const start = process.hrtime.bigint();
        const smallest = changed[i];
        if (smallest === 0) {
            if (changed[i + 1] === 0) {
                doubleOriginalIndexMap[`${i + 1}`] = `${i}`;
            } else {
                return [];
            }
        } else {
            const doubled = 2 * smallest;
            let j = Math.min(2 * i + 1, changed.length - 1);
            let found = false;
            while (changed[j] === doubled && j < changed.length - 1) {
                j++;
            }
            if (changed[j] >= doubled) {
                while (j > i) {
                    if (changed[j] > doubled) {
                        j--;
                    } else if (changed[j] < doubled) {
                        break;
                    } else {
                        while (j - 1 > i && changed[j - 1] === changed[j] && !doubleOriginalIndexMap[`${j - 1}`]) {
                            j--;
                        }

                        if (!doubleOriginalIndexMap[`${j}`]) {
                            found = true;
                            doubleOriginalIndexMap[`${j}`] = `${i}`;
                        }

                        break;
                    }
                }
            } else if (changed[j] < doubled) {
                while (j < changed.length) {
                    if (changed[j] > doubled) {
                        break;
                    } else if (changed[j] < doubled) {
                        j++
                    } else {
                        if (!doubleOriginalIndexMap[`${j}`]) {
                            found = true;
                            doubleOriginalIndexMap[`${j}`] = `${i}`;
                            break;
                        } else {
                            j++;
                        }
                    }
                }

            }

            // not found doubled
            // console.log(found);
            if (!found) {
                return [];
            }
        }

        i++;
        while (doubleOriginalIndexMap[`${i}`]) {
            i++;
        }
        // console.log('nanoseconds used:', process.hrtime.bigint() - start);
    }

    // console.log('time used:', Date.now() - start);

    return Object.values(doubleOriginalIndexMap).map(idxStr => changed[+idxStr]);
};

